  \"Advanced Multifunctional MMOD Shielding Project\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T15:24:58.762788\",\n\t\"name\": \"advanced-multifunctional-mmod-shielding-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;&lt;strong&gt;MMOD toughened, smart
  thermal blankets&lt;/strong&gt;. The project was successful over the past two years
  in developing and demonstrating by test (hypervelocity impact and thermal vacuum
  tests) an MMOD toughened, smart thermal blanket concept that is adaptable to different
  levels of MMOD threat and/or reliability levels. This blanket includes integrated
  impact sensor technology to determine the location and extent of MMOD impact damage.
  &lt;strong&gt;Combined MMOD/radiation protection shields&lt;/strong&gt;. The project
  also has made considerable progress in developing improved MMOD and radiation shields
  that have so far shown better MMOD performance than the best ISS MMOD shields, while
  decreasing radiation dosage by 30&#37; from solar proton events (SPE). &lt;strong&gt;Self-sealing
  materials in MMOD protection&lt;/strong&gt;. In FY13, impact tests on alternative
  shielding concepts will be performed that incorporate self-sealing materials able
  to close or reduce the size of holes in pressure shells. Tests to-date indicate
  that combinations of ionomer polymers and reinforcing materials are successful at
  closing 0.25&amp;rdquo; diameter holes in aluminum pressure shells under 0.3 atmosphere
  delta-pressure. Additional impact tests using these and other materials (thermoplastic
  and elastomeric polymers) are planned in FY13 for up to 1 atmosphere delta-pressure.&lt;/p&gt;\",\n\t\"license_title\":
